#!/usr/bin/env python3

dna = ('')
unique = set(dna)
print(unique)

nt_count={}
for nt in unique:
 count = dna.count(nt)
 nt_count[nt]=count
print('nt_count:',nt_count)

G_count = nt_count['G']
C_count = nt_count['C']
A_count = nt_count['A']
T_count = nt_count['T']
Total = G_count+C_count+A_count+T_count
GC_count = (G_count+C_count)/Total
print(GC_count)
